			function init(evt) {
				if ( window.svgDocument == null ) {
					svgDoc = evt.target.ownerDocument;

					for(var i in ufs) {
						var unidadefederal = svgDoc.getElementById("uf_" + ufs[i].codigo);
						if(unidadefederal) {
							unidadefederal.setAttributeNS(null, "uf", ufs[i].uf);
							unidadefederal.setAttributeNS(null, "nome", ufs[i].nome);

							var vlr = ufs[i].valor;
							if(vlr != undefined && vlr != '' && vlr > 0) {
								unidadefederal.setAttributeNS(null, "valor", ufs[i].valor);
								unidadefederal.setAttributeNS(null, "class", "hoverUF fil13 str4");	

								unidadefederal.addEventListener("mouseenter", function(e) {
									var texto = e.target.getAttributeNS(null, "nome") +" - "+	e.target.getAttributeNS(null, "valor");
									DisplayName(texto);
									texto = e.target.getAttributeNS(null, "uf") +" - "+	e.target.getAttributeNS(null, "valor");
									ShowTooltip(e, texto);
								}, true);

								unidadefederal.addEventListener("onmouseout", function(e) {
									ideTooltip();
								}, true);
							}
							else {
								unidadefederal.setAttributeNS(null, "class", "fil10 str4");
							}
						}
					}

					for(var i in meso) {
						//console.log(meso[i].codigo, meso[i].nome);
						var mesorreg = svgDoc.getElementById("meso_" + meso[i].codigo);
						var txtNumero = svgDoc.getElementById("num_" + meso[i].codigo);

						if(mesorreg) {
							mesorreg.setAttributeNS(null, "nome", meso[i].nome);
							mesorreg.setAttributeNS(null, "valor", meso[i].valor);

							mesorreg.addEventListener("mouseenter", function(e) {
							var texto = e.target.getAttributeNS(null, "nome");
							DisplayName(texto);
								//ShowTooltip(e, texto);
							}, true);

							mesorreg.addEventListener("onmouseout", function(e) {
								//HideTooltip();
							}, true);
						}

						if(txtNumero) {
							txtNumero.firstChild.data = meso[i].valor;
						}
					}
				}

				tooltip = svgDoc.getElementById('tooltip');
				tooltip_bg = svgDoc.getElementById('tooltip_bg');
			};

			function DisplayName(txt) {
				svgDoc.getElementById('path_name').firstChild.data = txt;
			};

			function ShowTooltip(evt, txt) {
				tooltip.firstChild.data = txt;
				tooltip.setAttributeNS(null,"x",(evt.clientX+11)*450);
				tooltip.setAttributeNS(null,"y",(evt.clientY+27)*450);
				tooltip.setAttributeNS(null,"visibility","visible");

				length = tooltip.getComputedTextLength();
				tooltip_bg.setAttributeNS(null,"width",(length+8000));
				tooltip_bg.setAttributeNS(null,"x",(evt.clientX+8)*450);
				tooltip_bg.setAttributeNS(null,"y",(evt.clientY+14)*450);
				tooltip_bg.setAttributeNS(null,"visibility","visible");
			};

			function HideTooltip(){
				tooltip.setAttributeNS(null,"visibility","hidden");
				tooltip_bg.setAttributeNS(null,"visibility","hidden");
			};



















































































































































